/**
 * Get table specific information from the infolist or descriptor
 * \param info Table to update
 * \param err  ObitErr for reporting errors.
 */
static void ObitTableIDI_PHASE_CALUpdate (ObitTableIDI_PHASE_CAL *in, ObitErr *err)
{
  olong i;
  ObitInfoType type;
  gint32 dim[MAXINFOELEMDIM];
  ObitTableDesc *desc;
   union ObitInfoListEquiv InfoReal; 

 /* error checks */
   g_assert(ObitErrIsA(err));
  if (err->error) return;
  g_assert (ObitIsA(in, &myClassInfo));

  /* Get Keywords */
   /* tabrev */
  in->tabrev = 1; 
  ObitInfoListGetTest(in->myDesc->info, "TABREV", &type, dim, 
		       (gpointer)&in->tabrev);
   /* numPol */
  if (!ObitInfoListGet(in->myDesc->info, "NO_POL", &type, dim, 
		       (gpointer)&in->numPol, err)) return;
   /* no_stkd */
  in->no_stkd = 1; 
  ObitInfoListGetTest(in->myDesc->info, "NO_STKD", &type, dim, 
		       (gpointer)&in->no_stkd);
   /* stk_1 */
  in->stk_1 = -1; 
  ObitInfoListGetTest(in->myDesc->info, "STK_1", &type, dim, 
		       (gpointer)&in->stk_1);
   /* no_band */
  in->no_band = 1; 
  ObitInfoListGetTest(in->myDesc->info, "NO_BAND", &type, dim, 
		       (gpointer)&in->no_band);
   /* no_chan */
  in->no_chan = 1; 
  ObitInfoListGetTest(in->myDesc->info, "NO_CHAN", &type, dim, 
		       (gpointer)&in->no_chan);
  in->ref_freq = 1.0; 
  InfoReal.dbl = 1.0; 
  type = OBIT_double;
  ObitInfoListGetTest(in->myDesc->info, "REF_FREQ", &type, dim, 
		       (gpointer)&InfoReal);
  if (type==OBIT_double) in->ref_freq = InfoReal.dbl;
  if (type==OBIT_float)  in->ref_freq = InfoReal.flt;
  in->chan_bw = 1.0; 
  InfoReal.dbl = 1.0; 
  type = OBIT_double;
  ObitInfoListGetTest(in->myDesc->info, "CHAN_BW", &type, dim, 
		       (gpointer)&InfoReal);
  if (type==OBIT_double) in->chan_bw = InfoReal.dbl;
  if (type==OBIT_float)  in->chan_bw = InfoReal.flt;
   /* ref_pixl */
  in->ref_pixl = 1.0; 
  ObitInfoListGetTest(in->myDesc->info, "REF_PIXL", &type, dim, 
		       (gpointer)&in->ref_pixl);
   /* obscode */
  strncpy (in->obscode, "    ", MAXKEYCHARTABLEIDI_PHASE_CAL); 
  ObitInfoListGetTest(in->myDesc->info, "OBSCODE", &type, dim, 
		       (gpointer)&in->obscode);
   /* ArrName */
  if (!ObitInfoListGet(in->myDesc->info, "ARRNAM", &type, dim, 
		       (gpointer)&in->ArrName, err)) return;
   /* RefDate */
  strncpy (in->RefDate, "YYYY-MM-DD", MAXKEYCHARTABLEIDI_PHASE_CAL); 
  ObitInfoListGetTest(in->myDesc->info, "RDATE", &type, dim, 
		       (gpointer)&in->RefDate);
   /* numTones */
  in->numTones = 1; 
  ObitInfoListGetTest(in->myDesc->info, "NO_TABS", &type, dim, 
		       (gpointer)&in->numTones);

  /* initialize column numbers/offsets */
  in->TimeOff = -1;
  in->TimeCol = -1;
  in->TimeIOff = -1;
  in->TimeICol = -1;
  in->SourIDOff = -1;
  in->SourIDCol = -1;
  in->antennaNoOff = -1;
  in->antennaNoCol = -1;
  in->ArrayOff = -1;
  in->ArrayCol = -1;
  in->FreqIDOff = -1;
  in->FreqIDCol = -1;
  in->CableCalOff = -1;
  in->CableCalCol = -1;
  in->State1Off = -1;
  in->State1Col = -1;
  in->PCFreq1Off = -1;
  in->PCFreq1Col = -1;
  in->PCReal1Off = -1;
  in->PCReal1Col = -1;
  in->PCImag1Off = -1;
  in->PCImag1Col = -1;
  in->PCRate1Off = -1;
  in->PCRate1Col = -1;
  in->State2Off = -1;
  in->State2Col = -1;
  in->PCFreq2Off = -1;
  in->PCFreq2Col = -1;
  in->PCReal2Off = -1;
  in->PCReal2Col = -1;
  in->PCImag2Off = -1;
  in->PCImag2Col = -1;
  in->PCRate2Off = -1;
  in->PCRate2Col = -1;
  /* Find columns and set offsets */
  desc = in->myDesc;
  if (desc->FieldName) {
    for (i=0; i<desc->nfield; i++) {
      if (!strncmp (desc->FieldName[i], "TIME    ", 8)) {
	 in->TimeOff = desc->offset[i];
 	 in->TimeCol = i;
      }
      if (!strncmp (desc->FieldName[i], "TIME_INTERVAL", 13)) {
	 in->TimeIOff = desc->offset[i];
 	 in->TimeICol = i;
      }
      if (!strncmp (desc->FieldName[i], "SOURCE_ID  ", 11)) {
	 in->SourIDOff = desc->offset[i];
 	 in->SourIDCol = i;
      }
      if (!strncmp (desc->FieldName[i], "ANTENNA_NO", 10)) {
	 in->antennaNoOff = desc->offset[i];
 	 in->antennaNoCol = i;
      }
      if (!strncmp (desc->FieldName[i], "ARRAY      ", 11)) {
	 in->ArrayOff = desc->offset[i];
 	 in->ArrayCol = i;
      }
      if (!strncmp (desc->FieldName[i], "FREQID", 6)) {
	 in->FreqIDOff = desc->offset[i];
 	 in->FreqIDCol = i;
      }
      if (!strncmp (desc->FieldName[i], "CABLE_CAL", 9)) {
	 in->CableCalOff = desc->offset[i];
 	 in->CableCalCol = i;
      }
      if (!strncmp (desc->FieldName[i], "STATE_1", 7)) {
	     in->State1Off = desc->offset[i];
 	     in->State1Col = i;
      }
      if (!strncmp (desc->FieldName[i], "PC_FREQ_1", 9)) {
	     in->PCFreq1Off = desc->offset[i];
 	     in->PCFreq1Col = i;
      }
      if (!strncmp (desc->FieldName[i], "PC_REAL_1", 9)) {
	     in->PCReal1Off = desc->offset[i];
 	     in->PCReal1Col = i;
      }
      if (!strncmp (desc->FieldName[i], "PC_IMAG_1", 9)) {
	     in->PCImag1Off = desc->offset[i];
 	     in->PCImag1Col = i;
      }
      if (!strncmp (desc->FieldName[i], "PC_RATE_1", 9)) {
	     in->PCRate1Off = desc->offset[i];
 	     in->PCRate1Col = i;
      }
      if (!strncmp (desc->FieldName[i], "STATE_2", 7)) {
	     in->State2Off = desc->offset[i];
 	     in->State2Col = i;
      }
      if (!strncmp (desc->FieldName[i], "PC_FREQ_2", 9)) {
	     in->PCFreq2Off = desc->offset[i];
 	     in->PCFreq2Col = i;
      }
      if (!strncmp (desc->FieldName[i], "PC_REAL_2", 9)) {
	     in->PCReal2Off = desc->offset[i];
 	     in->PCReal2Col = i;
      }
      if (!strncmp (desc->FieldName[i], "PC_IMAG_2", 9)) {
	     in->PCImag2Off = desc->offset[i];
 	     in->PCImag2Col = i;
      }
      if (!strncmp (desc->FieldName[i], "PC_RATE_2", 9)) {
	     in->PCRate2Off = desc->offset[i];
 	     in->PCRate2Col = i;
      }
     }
  }

  /* Check required columns */
  Obit_return_if_fail((in->TimeOff > -1), err,
       "ObitTableIDI_PHASE_CALUpdate: Could not find column Time");
  Obit_return_if_fail((in->TimeIOff > -1), err,
       "ObitTableIDI_PHASE_CALUpdate: Could not find column TimeI");
  Obit_return_if_fail((in->SourIDOff > -1), err,
       "ObitTableIDI_PHASE_CALUpdate: Could not find column SourID");
  Obit_return_if_fail((in->antennaNoOff > -1), err,
       "ObitTableIDI_PHASE_CALUpdate: Could not find column antennaNo");
  Obit_return_if_fail((in->ArrayOff > -1), err,
       "ObitTableIDI_PHASE_CALUpdate: Could not find column Array");
  Obit_return_if_fail((in->FreqIDOff > -1), err,
       "ObitTableIDI_PHASE_CALUpdate: Could not find column FreqID");
  Obit_return_if_fail((in->CableCalOff > -1), err,
       "ObitTableIDI_PHASE_CALUpdate: Could not find column CableCal");
  if (in->numPol>=1) {
    Obit_return_if_fail((in->State1Off > -1), err,
       "ObitTableIDI_PHASE_CALUpdate: Could not find column State1");
    Obit_return_if_fail((in->PCFreq1Off > -1), err,
       "ObitTableIDI_PHASE_CALUpdate: Could not find column PCFreq1");
    Obit_return_if_fail((in->PCReal1Off > -1), err,
       "ObitTableIDI_PHASE_CALUpdate: Could not find column PCReal1");
    Obit_return_if_fail((in->PCImag1Off > -1), err,
       "ObitTableIDI_PHASE_CALUpdate: Could not find column PCImag1");
  } /* end of if index in range */
  if (in->numPol>=2) {
    Obit_return_if_fail((in->State2Off > -1), err,
       "ObitTableIDI_PHASE_CALUpdate: Could not find column State2");
    Obit_return_if_fail((in->PCFreq2Off > -1), err,
       "ObitTableIDI_PHASE_CALUpdate: Could not find column PCFreq2");
    Obit_return_if_fail((in->PCReal2Off > -1), err,
       "ObitTableIDI_PHASE_CALUpdate: Could not find column PCReal2");
    Obit_return_if_fail((in->PCImag2Off > -1), err,
       "ObitTableIDI_PHASE_CALUpdate: Could not find column PCImag2");
  } /* end of if index in range */
} /* end ObitTableIDI_PHASE_CALUpdate */

/**
 * Copy table specific (keyword) information  to infolist.
 * \param info Table to update
 * \param err  ObitErr for reporting errors.
 */
static void ObitTableIDI_PHASE_CALDumpKey (ObitTableIDI_PHASE_CAL *in, ObitErr *err)
{
  ObitInfoList *info=NULL;
  ObitInfoType type;
  gint32 dim[MAXINFOELEMDIM] = {1,1,1,1,1};

 /* error checks */
   g_assert(ObitErrIsA(err));
  if (err->error) return;
  g_assert (ObitIsA(in, &myClassInfo));

  /* Set Keywords */
  if (in->myIO!=NULL) info = ((ObitTableDesc*)(in->myIO->myDesc))->info;
  else info = in->myDesc->info;
  /* tabrev */
  type  = OBIT_oint;
  dim[0] = 1;
  ObitInfoListAlwaysPut(info, "TABREV", type, dim, 
		  (gpointer)&in->tabrev);
  /* numPol */
  type  = OBIT_oint;
  dim[0] = 1;
  ObitInfoListAlwaysPut(info, "NO_POL", type, dim, 
		  (gpointer)&in->numPol);
  /* no_stkd */
  type  = OBIT_oint;
  dim[0] = 1;
  ObitInfoListAlwaysPut(info, "NO_STKD", type, dim, 
		  (gpointer)&in->no_stkd);
  /* stk_1 */
  type  = OBIT_oint;
  dim[0] = 1;
  ObitInfoListAlwaysPut(info, "STK_1", type, dim, 
		  (gpointer)&in->stk_1);
  /* no_band */
  type  = OBIT_oint;
  dim[0] = 1;
  ObitInfoListAlwaysPut(info, "NO_BAND", type, dim, 
		  (gpointer)&in->no_band);
  /* no_chan */
  type  = OBIT_oint;
  dim[0] = 1;
  ObitInfoListAlwaysPut(info, "NO_CHAN", type, dim, 
		  (gpointer)&in->no_chan);
  /* ref_freq */
  type  = OBIT_double;
  dim[0] = 1;
  ObitInfoListAlwaysPut(info, "REF_FREQ", type, dim, 
		  (gpointer)&in->ref_freq);
  /* chan_bw */
  type  = OBIT_double;
  dim[0] = 1;
  ObitInfoListAlwaysPut(info, "CHAN_BW", type, dim, 
		  (gpointer)&in->chan_bw);
  /* ref_pixl */
  type  = OBIT_oint;
  dim[0] = 1;
  ObitInfoListAlwaysPut(info, "REF_PIXL", type, dim, 
		  (gpointer)&in->ref_pixl);
  /* obscode */
  type  = OBIT_string;
  dim[0] = MAXKEYCHARTABLEIDI_PHASE_CAL;
  ObitInfoListAlwaysPut(info, "OBSCODE", type, dim, 
		  (gpointer)&in->obscode);
  /* ArrName */
  type  = OBIT_string;
  dim[0] = MAXKEYCHARTABLEIDI_PHASE_CAL;
  ObitInfoListAlwaysPut(info, "ARRNAM", type, dim, 
		  (gpointer)&in->ArrName);
  /* RefDate */
  type  = OBIT_string;
  dim[0] = MAXKEYCHARTABLEIDI_PHASE_CAL;
  ObitInfoListAlwaysPut(info, "RDATE", type, dim, 
		  (gpointer)&in->RefDate);
  /* numTones */
  type  = OBIT_oint;
  dim[0] = 1;
  ObitInfoListAlwaysPut(info, "NO_TABS", type, dim, 
		  (gpointer)&in->numTones);
   
} /* end ObitTableIDI_PHASE_CALDumpKey */
